import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <>
    <form onSubmit={handleSubmit}>
      <input></input>
      <input></input>
      <input></input>
      <button type="submit"></button>
    </form>
    </>
  );
};
